func BenchmarkMurmur32HashInt(b *testing.B) {
	murmur := New32()
	b.ReportAllocs()
	b.ResetTimer()
	for i := 0; i < b.N; i++ {
		murmur.HashInt(i)
	}
}

func BenchmarkMurmur32HashInt32(b *testing.B) {
	murmur := New32()
	b.ReportAllocs()
	b.ResetTimer()
	for i := 0; i < b.N; i++ {
		murmur.HashInt32(int32(i))
	}
}

